class Solution {
    func countSubarrays(_ nums: [Int], _ k: Int) -> Int {
        let maxElement = nums.max() ?? 0
        var count = 0
        var currentCount = 0
        var subarrayCount = 0

        for num in nums {
            if num == maxElement {
                currentCount += 1
                if currentCount >= k {
                    subarrayCount += 1
                }
            } else {
                if currentCount >= k {
                    subarrayCount += 1
                }
            }
            if num != maxElement || currentCount < k {
                count += subarrayCount
                if num != maxElement {
                    subarrayCount = 0
                }
            }
        }
        count += subarrayCount // Add remaining subarrays
        return count
    }
}
